import ContactAnimation from "../Animation/ContactA/ContactAnimation.js";
import "./Contact.css";
const Contact = () => {
  return (
    <div className="row">
      <div className="col-12 ">
        <div className="container p-3 mb-5">
          <div className="row">
            <div className="col-12 text-center   ">
              <ContactAnimation />
            </div>
          </div>
        </div>
      </div>
      <div className="col-12"></div>
    </div>
  );
};

export default Contact;
